import TodoItem from "./custom_components/TodoItem.jsx";
function Task({todoItem}){
    return (<>
     {todoItem.map((item) => (
        <TodoItem
          todoDate={item.dueDate}
          todoName={item.name}
          
        ></TodoItem>
      ))}
    </>)
}
export default Task;
